webpackJsonp([0xe5278c862d3d],{1217:function(a,e){a.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2013-01-16-macademia-nut-pancakes-rain-and-the-polynesian-culture-center/index.md absPath of file >>> MarkdownRemark",html:'<p>I hear it rains a lot in Hawaii in the winter. However, we are favored by the gods (probably because of all the times we visited the Tiki Room at Disneyland), and so we only had one day of major rain. I guess Mondays are like that even in Hawaii.</p>\n<p>Every day should begin with pancakes covered in Macadamia nut cream sauce from Boots and Kimo\'s</p>\n <img class="scale-image" src="IMG_1683.jpg" />\n <img class="scale-image" src="IMG_1684.jpg" />\n<p>At the LDS Temple in Laie</p>\n <img class="scale-image" src="IMG_1694.jpg" />\n<p>Opening coconuts with a sharp stick while wearing no shirt seems like it should come with a warning label but if you have that body you probably fear nothing but a steroid test:</p>\n <img class="scale-image" src="IMG_1701.jpg" />\n<p>Darin was about to take off his shirt here and really get jiggy:</p>\n <img class="scale-image" src="IMG_1708.jpg" />\n<p>The food at the Polynesan Cultural Center was mediocre, but the show is amazing. I\'m not sure if the guys from the various islands come as pyromaniacs but they must leave that way. It\'s inspiring to watch other people play with fire. I might have to buy a flaming baton. Sorry no pictures on this one - they forbid the taking of photos and you don\'t want to mess with a group of guys who look like they\'ve been chiseled from stone.</p>\n<p>In depth discussion about the use of a loin cloth in a public performance that involves dancing.</p>\n <img class="scale-image" src="IMG_1713.jpg" />',frontmatter:{title:"Macademia Nut Pancakes, Rain and the Polynesian Culture Center",date:"January 16, 2013",image:{childImageSharp:{sizes:{src:"/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-381d6.jpg"}}}}}},pathContext:{path:"/macademia-nut-pancakes-rain-and-the-polynesian-culture-center"}}}});
//# sourceMappingURL=path---macademia-nut-pancakes-rain-and-the-polynesian-culture-center-ea7956c43a3299fda36b.js.map